import { Grid } from "@mui/material";
import { Box, Container } from "@mui/system";
import "./App.css";
import Header from "./components/Header";
import VideoStreamer from "./components/VideoStreamer";

function App() {
    return (
        <Container>
            <Header />
            <hr />
            <Grid container spacing={1}>
                <Grid item xs={6}>
                    <VideoStreamer />
                </Grid>
                <Grid item xs={6}>
                    <Box>Hello</Box>
                </Grid>
            </Grid>
        </Container>
    );
}

export default App;
